import React from "react";
import ProductCard from "./ProductCard";

function Namkeen() {
  return (
    <div className="row">
      <ProductCard img="https://jagdishfarshan.com/Upload/Product/1/b2607d4e63d64108ace9c70eb540586d.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/2/f399adbec89f4331a2da6c04dd7be730.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/3/dd75860af51b4be6bdd19c3a792ba624.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/15/d2b4d7200357426aa317f219b543438f.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/16/9161c251d4a447678d0d5c985fab2df5.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/17/3ef9cbd8a44c4441a8599719352e0091.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/20/cec881f37efe4094ad3019b4ac9870a7.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
      <ProductCard img = "https://jagdishfarshan.com/Upload/Product/21/4904167f5462428bbaba32292c000e99.jpg" name="Lilo Chevdo" price="₹ 210.00 / 500gm"/>
    </div>
  );
}

export default Namkeen;
